import { useState, useEffect } from "react";

const UseEffectAPI = () => {
  const getUser = async () => {
    const respone = await fetch(
      `https://codeforces.com/api/blogEntry.comments?blogEntryId=79`
    );
    const data = await respone.json();
    console.log(data);
  };
};

useEffect(() => {
  getUser();
});

